import React from "react";
import { useState } from "react";
import style from "./addtask.module.css";
import axios from "axios";
import { useEffect } from "react";
const AddTask = () => {
  const [click, setClick] = useState(false);
  const [data, setData] = useState();
  useEffect(() => {
    axios
      .post("http://localhost:3001/users/singup", {
        username: "kkk",
        email: "llll",
        password: "ffff",
        tasks: [
          {
            taskName: "gggg",
          },
        ],
      })
      .then((res) => setData(res.data))
      .catch((err) => console.error(err));
  }, []);
  console.log(data);
  return (
    <div
      className={
        (click ? style.click : style.addTask) + " position-absolute center"
      }
    >
      <div
        className={
          (click ? style.btnclick : " ") + " global position-absolute center"
        }
        onClick={() => {
          click ? setClick(false) : setClick(true);
        }}
      >
        +
      </div>
      <div>
        <input type="text" placeholder="Add task" />
        <input type="text" placeholder="Add task" />
        <input type="text" placeholder="Add task" />
        <select>
          <option value="1">very important</option>
          <option value="0">important</option>
          <option value="-1">not important</option>
        </select>
        <input type="text" placeholder="Add task" />
      </div>
    </div>
  );
};

export default AddTask;
